Let's start with a simple GET request using reqwest: use dioxus::prelude::*;
use serde::Deserialize; #[derive(Debug, Deserialize)]
struct Todo { id: u32, title: String, completed: bool,
} async fn fetch_todo(id: u32) -> Result<Todo, reqwest::Error> { let url = format!("https://jsonplaceholder.typicode.com/todos/{}", id); reqwest::get(&url).await?.json().await
} fn TodoFetcher(cx: Scope) -> Element { let todo = use_future(cx, (), |_| async move { fetch_todo(1).await }); cx.render(rsx! { div { match todo.value() { Some(Ok(todo)) => rsx! { h1 { "Todo" } p { "Title: {todo.title}" } p { "Completed: {todo.completed}" } }, Some(Err(_)) => rsx! { p { "Error fetching todo" } }, None => rsx! { p { "Loading..." } }, } } })
}

