Now let's implement a POST request to create a new todo: async fn create_todo(title: String) -> Result<Todo, reqwest::Error> { let client = reqwest::Client::new(); let new_todo = serde_json::json!({ "title": title, "completed": false, }); client.post("https://jsonplaceholder.typicode.com/todos") .json(&new_todo) .send() .await? .json() .await
} fn TodoCreator(cx: Scope) -> Element { let mut title = use_state(cx, String::new); let mut created_todo = use_state(cx, || None::<Todo>); let onsubmit = move |evt: FormEvent| { evt.prevent_default(); let title_value = title.get().clone(); cx.spawn({ to_owned![created_todo]; async move { match create_todo(title_value).await { Ok(todo) => created_todo.set(Some(todo)), Err(e) => log::error!("Error creating todo: {}", e), } } }); }; cx.render(rsx! { form { onsubmit: onsubmit, input { value: "{title}", oninput: move |evt| title.set(evt.value.clone()), } button { type: "submit", "Create Todo" } } {created_todo.get().as_ref().map(|todo| rsx! { div { h2 { "Created Todo" } p { "Title: {todo.title}" } p { "ID: {todo.id}" } } })} })
}

